CREATE TABLE `simulation` (
  `id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `description` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL,
  `run_date` DATE COLLATE utf8mb4_bin DEFAULT NULL,
  `queued_symbols` integer COLLATE utf8mb4_bin DEFAULT 0,
  `attributes` TEXT COLLATE utf8mb4_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  INDEX `IDX_Description` (`description`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;


CREATE TABLE `simulation_transaction` (
  `id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `simulation_id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `create_date` DATE COLLATE utf8mb4_bin DEFAULT NULL,
  `shares` integer COLLATE utf8mb4_bin DEFAULT 0,
  `symbol_id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `commission` double(9,3) COLLATE utf8mb4_bin DEFAULT NULL,
  `purchase_price` double(9,3) COLLATE utf8mb4_bin NOT NULL,
  `sell_price` double(9,3) COLLATE utf8mb4_bin NOT NULL,
  `purchase_date` DATE COLLATE utf8mb4_bin NOT NULL,
  `sell_date` DATE COLLATE utf8mb4_bin NOT NULL,
  PRIMARY KEY (`id`),
  INDEX `IDX_Symbol` (`symbol_id`),
  KEY `FK_SimulationTransaction_Simulation` (`simulation_id`),
  CONSTRAINT `FK_SimulationTransaction_Simulation` FOREIGN KEY (`simulation_id`) REFERENCES `simulation` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;


CREATE TABLE `exchange_market` (
  `id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `short_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL,
  `long_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;



CREATE TABLE `symbol` (
  `id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `identifier` varchar(10) COLLATE utf8mb4_bin NOT NULL,
  `description` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL,
  `active` Boolean COLLATE utf8mb4_bin DEFAULT TRUE,
  `exchange_market_id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_Symbol_ExchangeMarket` (`exchange_market_id`),
  CONSTRAINT `FK_Symbol_ExchangeMarket` FOREIGN KEY (`exchange_market_id`) REFERENCES `exchange_market` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

CREATE UNIQUE INDEX `idx_symbol_identifier_exchange_market_id`  ON `ga_stocks`.`symbol` (identifier, exchange_market_id) COMMENT '' ALGORITHM DEFAULT LOCK DEFAULT;

CREATE TABLE `holiday_calendar` (
  `id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `exchange_market_id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `holiday_date` DATE COLLATE utf8mb4_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  INDEX `IDX_HolidayDate` (`holiday_date`),
  INDEX `IDX_ExchangeMarket_HolidayDate` (`exchange_market_id`,`holiday_date`),
  CONSTRAINT `FK_HolidayCalendar_ExchangeMarket` FOREIGN KEY (`exchange_market_id`) REFERENCES `exchange_market` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;




